import React, { useCallback, useState } from "react";
import { Form, Button } from "react-bootstrap";
import { useNavigation } from "react-navi";

interface FormInput {
  userName: string;
}

interface FormError {
  userName: boolean;
}

const CreateMeeting = () => {
  const navigation = useNavigation();

  const generateMeetingId = useCallback((): string => {
    const meetingId = Math.random().toString(36).substring(9);
    return meetingId;
  }, []);

  const [formData, setFormData] = useState<FormInput>({ userName: "" });
  const [formDataError, setFormDataError] = useState<FormError>({
    userName: false,
  });

  return (
    <div
      style={{
        alignContent: "center",
        margin: "auto",
        marginTop: "50px",
        height: "50%",
        width: "40%",
        backgroundColor: "burlywood",
        paddingTop: "100px",
        paddingBottom: "100px",
        paddingLeft: "50px",
        paddingRight: "50px",
      }}
    >
      <Form className="text-center">
        <Form.Group className="mb-3" controlId="username">
          <Form.Label>Username</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter username"
            isInvalid={formDataError.userName}
            onChange={(e) => {
              setFormData({
                userName: e.target.value,
              });
            }}
          />
        </Form.Group>
        <Button
          variant="primary"
          type="submit"
          onClick={(event) => {
            event.preventDefault();
            console.log("clicked");
            const meetingId = generateMeetingId();
            navigation.navigate(`meeting/${meetingId}`);
          }}
        >
          Create meeting
        </Button>
      </Form>
    </div>
  );
};

export default CreateMeeting;
